        public IList<Search> GetSearches(WonderType wonder)
        {
            return wonder switch
            {
                WonderType.ChichenItza => chichenItza,
                WonderType.ChristRedeemer => christRedeemer,
                WonderType.Colosseum => colosseum,
                WonderType.GreatWall => greatWall,
                WonderType.MachuPicchu => machuPicchu,
                WonderType.Petra => petra,
                WonderType.PyramidsGiza => pyramidsGiza,
                WonderType.TajMahal => tajMahal,
                _ => null
            };
        }

        public IList<string> GetSearchSuggestions(WonderType wonder)
        {
            return wonder switch
            {
                WonderType.ChichenItza => chichenItzaSuggestions,
                WonderType.ChristRedeemer => christRedeemerSuggestions,
                WonderType.Colosseum => colosseumSuggestions,
                WonderType.GreatWall => greatWallSuggestions,
                WonderType.MachuPicchu => machuPicchuSuggestions,
                WonderType.Petra => petraSuggestions,
                WonderType.PyramidsGiza => pyramidsGizaSuggestions,
                WonderType.TajMahal => tajMahalSuggestions,
                _ => null
            };
        }

        public Search GetSearch(WonderType wonder, string artifactId)
        {
            var id = int.Parse(artifactId);

            return GetSearches(wonder).FirstOrDefault(s => s.Id == id);
        }
    }
